import logo from "../../images/logo.png";
import { Logo, Wrapper } from "./styled";
import bg from "../../images/background.png";

export const Top = () => {
  return (
<Wrapper bg={bg}>
      <Logo src={logo} />
      <h1>
        <strong>Felgi, CNC, Malowanie proszkowe</strong>
      </h1>
    </Wrapper>
  );
};
